    /**
     * Ëé∑ÂèñÊµèËßàÂô®Â∏ßÁéáÁî®ÁöÑÂõûË∞ÉÂáΩÊï∞
     * @param {DOMHighResTimeStamp} timestamp
     * @returns {void}
     */
    _webfpstick(timestamp) {
        // Â≠òÂú®Â§öÊ¨°ÂºÄÂÖ≥ÂäüËÉΩÂØºËá¥ËØ•ÂáΩÊï∞Â§ßÈáèËß¶ÂèëÁöÑÊÉÖÂÜµ„ÄÇ
        // ËøôÊ†∑Â≠êËÆæËÆ°ÔºåÊØèÂ∏ßÂè™Ëß¶Âèë‰∏ÄÊ¨°
        // ËøôÈáåÂà§Êñ≠ webfpson ÊòØÂê¶‰∏∫ÁúüÊù•Âà§Êñ≠ÊòØÂê¶Ë¶ÅÁªßÁª≠Êõ¥Êñ∞Â∏ßÊï∞Ôºå
        // ËøôÊ†∑ÊâçËÉΩÊ≠£Â∏∏ÂÖ≥Èó≠„ÄÇ
        if (this.webfpson) {
            this.webfpstick_end = false;
            this.webfpscnt++;
            this.webfpsn = 1000 / (timestamp - this.webfpstime);
            this.webfpstime = timestamp;
            // ËøôÈáåÁöÑ bind(this) ÈùûÂ∏∏ÈáçË¶ÅÔºåËÆ©ÂõûË∞ÉÁöÑÊó∂ÂÄô this ÊåáÂêëÂΩìÂâçÁöÑ this„ÄÇ
            requestAnimationFrame(this._webfpstick.bind(this));
        }
        else {
            this.webfpstick_end = true;
        }
    }

